import React from "react";
import { Link, Outlet } from "react-router-dom";

import { Wrapper } from './Form.styles.js';

const Header = () => {

    return (
        <>
            <Wrapper>
                    <h1>Header</h1>
                    <nav
                    style={{
                        borderBottom: "solid 1px",
                        paddingBottom: "1rem"
                    }}
                    >
                    <Link to="/invoices">Invoices</Link> |{" "} {/* Link som global navigation */}
                    <Link to="/expenses">Expenses</Link>
                    </nav>
                    <Outlet/> {/* outlet renderar child route */}
            </Wrapper>
        </>
    )
}

export default Header
